import React from 'react'
import CustomDropdown from './CustomDropdown'
import { StyledContent } from './styles/Content.styled'

function ReadySize({registerName, control, stitchOptions, errors, errorMessage}) {
   
    
  return (
    <StyledContent>
        
        <div >   
            <CustomDropdown
              registerName={`${registerName}.stitchType`}
              control={control}
              options={stitchOptions}
              placeholder={"Seçiniz..."}
              errors={errors}
              errorMessage={errorMessage}
            />
          </div>

    </StyledContent>
  )
}
export default ReadySize
